import React from 'react'
import { Col } from 'react-bootstrap'
import imgcard from "../images/man.jpeg"
export default function CardMovie() {
  return (
    <Col  className='my-1'>
    <div className='card'>
   <img src={imgcard} className='card-image' alt="hu"/>
    </div> 
    </Col>
  )
}
